import React from 'react';
import {BrowserRouter} from 'react-router-dom'
import './App.css';
import Nav from './components/Nav'

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          <Nav />
        </header>
      </div>
    </BrowserRouter>

  );
}

export default App;
